import React from "react";
function Home()
{
    return(
        <section id="header">
        <div className="container-fluid nav_bg">
        <div className="row">
          <div className="col-10 mx-auto">
            <div>
            <h1>Want to know about SVNIT's Student Chapters!!</h1>
            <a href="" className="btn-get-started"></a>
            </div>
          </div>
        </div>
        </div> 
        </section>
    );
}
export default Home;
